import React from 'react';
import HeroSection from './components/HeroSection';
import AboutSection from './components/AboutSection';
import GuestsSection from './components/GuestsSection';
import './App.css';

function App() {
  return (
    <div className="App">
      <HeroSection />
      <AboutSection />
      <GuestsSection />
    </div>
  );
}

export default App;
